import React, { useState } from "react";
import axios from "axios";

function App() {
  const [jdFile, setJdFile] = useState(null);
  const [resumes, setResumes] = useState([]);
  const [results, setResults] = useState([]); // always an array
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState("");

  const handleAnalyze = async (e) => {
    e.preventDefault();
    setError("");
    if (!jdFile || resumes.length === 0) {
      setError("Please upload a JD and at least one resume.");
      return;
    }
    setLoading(true);
    setResults([]);

    const form = new FormData();
    form.append("jd", jdFile);
    resumes.forEach((f) => form.append("resumes", f));

    try {
      const res = await axios.post("http://127.0.0.1:8000/analyze/", form, {
        headers: { "Content-Type": "multipart/form-data" },
        timeout: 120000, // allow some time for processing
      });
      console.log("Backend response:", res.data);
      const data = res.data || {};
      setResults(data.results || []);
      if (data.error) setError(data.error);
    } catch (err) {
      console.error("Analyze error:", err);
      setError(err?.response?.data?.error || err.message || "Network error");
      setResults([]);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div style={{ maxWidth: 1000, margin: "40px auto", fontFamily: "Arial, sans-serif" }}>
      <div style={{ padding: 24, borderRadius: 12, boxShadow: "0 2px 12px rgba(0,0,0,0.08)" }}>
        <h1 style={{ textAlign: "center" }}>Resume Screening Tool</h1>
        <form onSubmit={handleAnalyze}>
          <div style={{ marginBottom: 12 }}>
            <label style={{ fontWeight: 600 }}>Upload Job Description (JD): </label>
            <input required type="file" accept=".txt,.docx,.pdf" onChange={(e) => setJdFile(e.target.files[0])} />
          </div>
          <div style={{ marginBottom: 16 }}>
            <label style={{ fontWeight: 600 }}>Upload Resumes: </label>
            <input required type="file" multiple accept=".pdf,.docx,.txt" onChange={(e) => setResumes(Array.from(e.target.files))} />
          </div>
          <div style={{ textAlign: "center" }}>
            <button type="submit" disabled={loading} style={{ padding: "10px 20px", borderRadius: 8, background: "#2d8cf0", color: "#fff", border: "none" }}>
              {loading ? "Analyzing..." : "Analyze"}
            </button>
          </div>
        </form>
        {error && <p style={{ color: "crimson", marginTop: 12 }}>{error}</p>}
      </div>

      <div style={{ marginTop: 28 }}>
        <h2 style={{ textAlign: "center" }}>Analysis Results</h2>

        {results && results.length > 0 ? (
          <table style={{ width: "100%", borderCollapse: "collapse", marginTop: 12 }}>
            <thead>
              <tr style={{ background: "#f3f4f6" }}>
                <th style={th}>Name</th>
                <th style={th}>Strengths</th>
                <th style={th}>Missing</th>
                <th style={th}>Primary Score</th>
                <th style={th}>Secondary Score</th>
                <th style={th}>Overall Score</th>
              </tr>
            </thead>
            <tbody>
              {results.map((r, i) => (
                <tr key={i}>
                  <td style={td}>{r["Name"]}</td>
                  <td style={td}>{r["Strengths"] || "-"}</td>
                  <td style={td}>{r["Missing"] || "-"}</td>
                  <td style={td}>{r["Primary Score"] ?? "-"}</td>
                  <td style={td}>{r["Secondary Score"] ?? "-"}</td>
                  <td style={{ ...td, fontWeight: 700 }}>{r["Overall Score"] ?? "-"}</td>
                </tr>
              ))}
            </tbody>
          </table>
        ) : (
          <p style={{ textAlign: "center", color: "#666", marginTop: 20 }}>{loading ? "Analyzing..." : "No results yet. Upload files and click Analyze."}</p>
        )}
      </div>
    </div>
  );
}

const th = { border: "1px solid #e6e6e6", padding: 10, textAlign: "left" };
const td = { border: "1px solid #e6e6e6", padding: 10 };

export default App;
